INSERT INTO `articles` VALUES (1,1,1,'10 Tips Desain Grafis untuk Pemula yang Ingin Profesional','10-tips-desain-grafis-pemula','Panduan lengkap untuk pemula yang ingin belajar desain grafis dengan benar.','Belajar desain grafis bisa dimulai dengan memahami prinsip-prinsip dasar. Artikel ini membahas 10 tips yang akan membantu Anda menjadi desainer yang lebih baik. Dari tipografi, komposisi, hingga penggunaan warna yang tepat.','https://placehold.co/800x450/f97316/white?text=Design+Tips','published','2026-01-29 08:42:28',NULL,NULL,'2026-02-03 08:42:28','2026-02-03 08:42:28',NULL),(2,1,2,'Cara Membuat Motion Graphics yang Menarik dengan After Effects','motion-graphics-after-effects','Belajar membuat animasi motion graphics profesional dari nol.','Motion graphics adalah seni menggerakkan elemen visual untuk menceritakan sebuah cerita. Dalam tutorial ini, kita akan belajar membuat motion graphics dasar menggunakan Adobe After Effects dengan langkah-langkah yang mudah diikuti.','https://placehold.co/800x450/f97316/white?text=Motion+Graphics','published','2026-01-24 08:42:28',NULL,NULL,'2026-02-03 08:42:28','2026-02-03 08:42:28',NULL),(3,1,3,'Strategi Jual Assets di Microstock untuk Pemula','strategi-jual-assets-microstock','Panduan lengkap untuk pemula yang ingin menghasilkan passive income dari microstock.','Microstock adalah platform yang memungkinkan Anda menjual karya desain, foto, dan video dengan royalti. Artikel ini akan mengajarkan strategi yang tepat untuk memulai dan mengembangkan bisnis microstock Anda.','https://placehold.co/800x450/f97316/white?text=Microstock','published','2026-01-19 08:42:28',NULL,NULL,'2026-02-03 08:42:28','2026-02-03 08:42:28',NULL),(4,1,4,'5 Tools Design yang Wajib Dimiliki Setiap Designer','5-tools-design-wajib','Rekomendasi tools design terbaik untuk workflow yang lebih cepat dan efisien.','Sebagai designer profesional, Anda membutuhkan tools yang tepat untuk meningkatkan produktivitas. Berikut adalah 5 tools design yang wajib dimiliki untuk workflow yang lebih efisien.','https://placehold.co/800x450/f97316/white?text=Design+Tools','published','2026-01-31 08:42:28',NULL,NULL,'2026-02-03 08:42:28','2026-02-03 08:42:28',NULL),(5,1,2,'Menjadi Fullstack Motion Designer dengan Adobe Suite','fullstack-motion-designer','Kuasai Adobe Suite untuk menjadi motion designer yang versatile.','Motion designer modern perlu menguasai beberapa tools dari Adobe Suite. Artikel ini menjelaskan bagaimana cara menjadi motion designer yang komprehensif dengan menguasai Premiere Pro, After Effects, dan Character Animator.','https://placehold.co/800x450/f97316/white?text=Adobe+Suite','published','2026-01-27 08:42:28',NULL,NULL,'2026-02-03 08:42:28','2026-02-03 08:42:28',NULL),(6,1,1,'Fotografi Produk untuk Penjualan Online: Panduan Lengkap','fotografi-produk-online','Teknik fotografi produk yang akan meningkatkan konversi penjualan Anda.','Fotografi produk yang baik adalah kunci untuk meningkatkan penjualan online Anda. Dalam artikel ini, kita akan membahas teknik lighting, komposisi, dan editing untuk menghasilkan foto produk yang profesional dan menarik pembeli.','https://placehold.co/800x450/f97316/white?text=Product+Photography','published','2026-01-22 08:42:28',NULL,NULL,'2026-02-03 08:42:28','2026-02-03 08:42:28',NULL);
