INSERT INTO `course_reviews` VALUES (5,'da7c2eaf-489d-4abf-b28d-e099e7980203',1,449,5,'Kursus ini sangat comprehensive dan mudah diikuti. Instruktur menjelaskan dengan detail dan memberikan banyak contoh praktis.',1,'2026-01-22 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(6,'21afcbf7-fd9e-47fb-8011-c1d62c8c8dbb',1,450,5,'Materi yang diberikan sangat relevan dengan kebutuhan industri saat ini. Content quality super baik dan terstruktur dengan baik.',1,'2026-01-12 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(7,'fcfe090a-6b52-4ec0-92a8-3ed480b71147',1,451,4,'Kursus ini memberikan nilai yang sangat baik. Saya sudah belajar banyak hal baru yang bisa langsung diaplikasikan.',1,'2026-01-04 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(8,'4b40a270-d8bb-48a5-911e-f26561a39c80',1,452,5,'Worth every penny! Instruktur sangat responsif dan membantu dalam setiap pertanyaan saya.',1,'2026-02-02 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(9,'3193cfe7-5e1d-49a5-ac12-be88241812d2',1,453,4,'Konten sangat bagus dan helpful. Daya support dari komunitas juga sangat responsif dan supportive.',1,'2026-01-11 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(10,'27b3141b-52da-4c48-be14-dadd83f538e8',1,454,5,'Saya sangat puas dengan kursus ini. Video tutorial berkualitas HD dan narasi sangat jelas dan mudah dipahami.',1,'2026-01-28 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(11,'dd8742c6-19af-47ac-a8bc-f951d81cf0f9',1,455,5,'Pembimbing sangat baik dan responsif. Saya bisa bertanya kapan saja dan selalu mendapat jawaban yang memuaskan.',1,'2026-02-01 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(12,'316b2c99-1197-473f-9b51-e8d1e2271629',1,456,5,'Ini adalah investasi terbaik untuk pengembangan skill saya. Materi sangat praktis dengan banyak studi kasus nyata.',1,'2026-01-16 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(13,'01774d35-d47c-49d2-8b3a-84a9b78ffd47',1,457,5,'Kualitas konten luar biasa! Instruktur menjelaskan konsep kompleks dengan cara yang sangat simpel dan mudah dimengerti.',1,'2026-01-08 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(14,'41817f4f-646d-4c74-af49-d824b020ab9d',1,458,4,'Sangat worth it! Bukan cuma dapat kursus, tapi juga akses ke komunitas yang supportive dan collaborative.',1,'2026-01-20 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(15,'cb6158b6-b0fa-4d84-a54a-752bd8df5dac',1,459,5,'Saya sudah coba beberapa kursus online, tapi ini adalah yang paling comprehensive dan terstruktur dengan sangat baik.',1,'2026-01-20 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(16,'1850f6ce-18a3-44eb-acec-0dc48ea05366',1,460,5,'Video production quality sangat tinggi. Subtitle juga tersedia yang membuat saya bisa belajar dengan lebih fleksibel.',1,'2026-01-29 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(17,'8bcfb60f-ee79-410b-88ba-427273185d24',1,461,5,'Instruktur benar-benar ahli di bidangnya. Banyak sharing pengalaman praktis dari lapangan yang sangat valuable.',1,'2026-02-02 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(18,'89e91493-526f-4c29-8da8-2806095cabca',1,462,5,'Saya sudah selesai kursus ini dan langsung bisa apply ilmunya untuk project freelance dengan hasil yang memuaskan.',1,'2026-01-08 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(19,'6a6c48f3-900d-424a-8466-b2bb7edc7206',1,463,5,'Kursus ini mengubah perspektif saya tentang industri ini. Sekarang saya punya roadmap yang jelas untuk career development.',1,'2026-01-11 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(20,'a1c17c98-4300-4a52-aab2-7e999e2cd64a',1,464,5,'Materi terupdate dan selalu mengikuti trend terbaru. Instruktur rutin mengupdate course dengan konten-konten baru yang relevant.',1,'2026-01-10 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(21,'7d16a285-a053-4c0b-98a2-ca14b19da268',1,465,5,'Community forum sangat aktif dan helpful. Setiap pertanyaan dijawab dengan cepat dan detail oleh instruktur dan member.',1,'2026-01-31 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(22,'fc26d7cd-40e7-478b-9fff-f2878945cf92',1,466,4,'Saya merekomendasikan kursus ini ke semua teman-teman saya. Mereka semua jadi senang dan merasakan manfaatnya.',1,'2026-01-19 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(23,'1256f05d-0e7d-4116-8764-0435a1accb14',1,467,5,'Harga sangat reasonable untuk kualitas yang diberikan. Ini paling value for money dibanding kursus lain di market.',1,'2026-01-11 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(24,'d14d38e9-3244-4f06-8ea4-7736886a92f5',1,468,5,'Instruktur punya cara mengajar yang sangat engaging. Saya tidak pernah merasa bosan saat mengikuti setiap session.',1,'2026-01-05 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(25,'4224595d-df7a-4079-b6a9-4b21f3eb050d',1,469,5,'Saya sudah belajar dari berbagai sumber, tapi DigitaLabs punya cara tersendiri yang membuat semua jadi clear.',1,'2026-01-22 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(26,'a2d9cc64-e274-4652-b060-9e8b9789b996',1,470,4,'Portfolio project yang ada di kursus sangat helpful untuk portofolio saya. Client jadi lebih tertarik dengan work saya.',1,'2026-01-28 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(27,'5b53961f-f7c0-4cbb-bd1e-4ffa9cb39a98',1,471,5,'Kursus ini diajarkan dengan very systematic approach. Dari fundamental sampai advanced, semua terstruktur dengan sangat baik.',1,'2026-01-12 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(28,'d055e275-90cc-4037-9f44-e3148cb2043a',1,472,5,'Support team sangat responsif dan helpful. Ketika ada issue dengan akses, mereka langsung bantu solve masalahnya.',1,'2026-01-18 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(29,'4ec3058d-21a7-470a-ac2d-a3c5c8d48e26',1,473,5,'Saya puas dengan progress saya setelah mengikuti kursus ini. Skill saya sudah meningkat drastis dalam beberapa minggu.',1,'2026-01-27 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(30,'8166aab9-bc88-442b-bff5-510555202469',1,474,5,'Instruktur tidak hanya mengajar, tapi juga memberikan guidance untuk career development yang sangat helpful.',1,'2026-01-13 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(31,'00377ee6-6dd8-4256-8117-bd9b0ec9f2e3',1,475,5,'Video quality dan production value sangat professional. Terlihat instruktur dan team benar-benar peduli dengan kualitas.',1,'2026-01-13 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(32,'d8316542-8af1-475f-a9e9-5a188d4866b7',1,476,5,'Banyak resource tambahan yang disediakan selain video. PDF, template, tools semua ada dan sangat membantu pembelajaran.',1,'2026-01-15 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(33,'279cfdd3-d79b-46c0-9b6b-daa6e42d4085',1,477,5,'Saya bisa belajar dengan pace saya sendiri. Tidak ada deadline yang ketat, jadi saya bisa balance dengan pekerjaan lain.',1,'2026-01-23 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14'),(34,'2de495f6-b719-4221-aec9-3e5df687795b',1,478,5,'Course ini benar-benar game changer untuk saya. Terima kasih DigitaLabs untuk sharing ilmu yang sangat valuable!',1,'2026-01-10 08:27:14','2026-02-03 08:27:14','2026-02-03 08:27:14');
