INSERT INTO `testimonials` VALUES (1,'Ardi Septiawan','Freelance Designer','https://i.pravatar.cc/150?img=1','Kursus DigitaLabs benar-benar mengubah cara saya bekerja. Saya sekarang bisa handle project yang lebih kompleks dengan confidence tinggi.',5,1,1,'2026-02-03 08:27:14','2026-02-03 08:27:14'),(2,'Putu Pasek Rentijaya','Motion Graphics Artist','https://i.pravatar.cc/150?img=2','Saya sudah coba banyak kursus online, tapi DigitaLabs adalah yang paling comprehensive dan detailed dalam pengajarannya.',5,1,2,'2026-02-03 08:27:14','2026-02-03 08:27:14'),(3,'Alantio','UI/UX Designer','https://i.pravatar.cc/150?img=3','Instruktur sangat knowledgeable dan cara mengajarnya membuat pembelajaran jadi fun dan engaging untuk setiap sesi.',5,1,3,'2026-02-03 08:27:14','2026-02-03 08:27:14'),(4,'Kopi Jahe','Content Creator','https://i.pravatar.cc/150?img=4','DigitaLabs memberikan structure learning yang perfect dengan live session, Q&A, dan community support yang sangat helpful.',5,1,4,'2026-02-03 08:27:14','2026-02-03 08:27:14'),(5,'Sarah Kusuma','Entrepreneur','https://i.pravatar.cc/150?img=5','Value yang saya dapat dari kursus ini jauh lebih besar dari harga yang saya bayarkan. Semua materi praktis dan actionable.',5,1,5,'2026-02-03 08:27:14','2026-02-03 08:27:14'),(6,'Rendra Wijaya','Brand Strategist','https://i.pravatar.cc/150?img=6','Kualitas course DigitaLabs sangat profesional. Setiap materi dirancang dengan matang dan relevan dengan industri terkini.',5,1,6,'2026-02-03 08:27:14','2026-02-03 08:27:14'),(7,'Vina Maharani','Video Producer','https://i.pravatar.cc/150?img=7','Saya sangat terkesan dengan production quality dan detail instruction. Ini adalah masterclass dari industry experts yang sebenarnya.',5,1,7,'2026-02-03 08:27:14','2026-02-03 08:27:14'),(8,'Hendrikus Santoso','Digital Marketing Manager','https://i.pravatar.cc/150?img=8','Kursus ini mengajarkan soft skill dan hard skill sekaligus dengan balanced approach yang membuat saya grow di berbagai aspek.',5,1,8,'2026-02-03 08:27:14','2026-02-03 08:27:14'),(9,'Lucia Puspita','Web Designer','https://i.pravatar.cc/150?img=9','Saya sudah mengikuti kursus ini dan merekomendasikan ke banyak orang. Feedback semua positive dan mereka upgrade skill dengan cepat.',5,1,9,'2026-02-03 08:27:14','2026-02-03 08:27:14'),(10,'Bimo Prakoso','Creative Director','https://i.pravatar.cc/150?img=10','Instruktur memiliki pengalaman bertahun-tahun dan sharing pengalaman praktikal yang sangat berharga dan benar-benar actionable.',5,1,10,'2026-02-03 08:27:14','2026-02-03 08:27:14'),(11,'Devi Lestari','Graphic Designer','https://i.pravatar.cc/150?img=11','DigitaLabs membantu saya transition dari career yang berbeda. Kursus ini beginner-friendly tapi juga comprehensive untuk yang advanced.',5,1,11,'2026-02-03 08:27:14','2026-02-03 08:27:14'),(12,'Irfan Hamdani','Animator','https://i.pravatar.cc/150?img=12','Komunitas DigitaLabs sangat supportive dan collaborative. Saya belajar dari instruktur dan juga dari member lain di komunitas.',4,1,12,'2026-02-03 08:27:14','2026-02-03 08:27:14'),(13,'Maya Rahma','Photography Director','https://i.pravatar.cc/150?img=13','Saya berhasil mendapat project premium setelah mengikuti kursus ini. Portfolio saya jadi lebih strong dan client percaya dengan skill saya.',5,1,13,'2026-02-03 08:27:14','2026-02-03 08:27:14'),(14,'Aditya Nugroho','Product Designer','https://i.pravatar.cc/150?img=14','Materi terupdate mengikuti perkembangan industri terkini. Tidak ketinggalan dengan trend dan best practices yang sedang berlaku sekarang.',5,1,14,'2026-02-03 08:27:14','2026-02-03 08:27:14'),(15,'Rizka Amalia','Content Strategist','https://i.pravatar.cc/150?img=15','ROI dari kursus ini sangat tinggi. Investment yang saya keluarkan kembali dalam beberapa project pertama yang saya tangani dengan sukses.',5,1,15,'2026-02-03 08:27:14','2026-02-03 08:27:14');
